import React, { Component } from "react";
import 'bootstrap/dist/css/bootstrap.css'

class Nav extends Component {
  render() {
    return (
      <>
        <nav class="navbar navbar-default">
                <div class="container-fluid">
                  <div class="navbar-header">
                    <a class="navbar-brand" href="/visited/8758183">김현호</a>
                  </div>
                  <div>
                    <ul class="nav nav-tabs">
                      <li role="presentation"><a href="/visited/8758183">Home</a></li>
                      <li role="presentation"><a href="/visited/8758183/notice">Notice</a></li>
                      <li role="presentation"><a href="/visited/8758183/checklist">Check List</a></li> 
                      <li role="presentation" class="active"><a href="/visited/8758183/maps">Maps</a></li> 
                      <a class="navbar-right" href="/">Helpusiness</a> 
                    </ul>
                  </div>
                </div>
			  </nav> 
      </>
    );
  }
}

export default Nav;
